INSERT INTO `examination_record` VALUES ('609', '1.简述计算机通信网的主要任务。', null, null, null, null, null, null, null, '1.数据传输2提供资源共享3提高系统可靠性4进行分布式处理5对分散对象提供实时集中控制与管理功能6节省软硬件的开销7方便用户，易于扩充', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('610', '2.简述数据链路层采用最简单流量控制时，在发送节点的协议算法。', null, null, null, null, null, null, null, '①从主机取一个数据帧；②将数据帧送到数据链路层的发送缓冲区；③将发送缓冲区中的数据帧发送出去；④等待；⑤若收到由接收节点发过来的信息，则从主机取一个新的数据帧，然后转到②。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('611', '3简述网络互连的优点。', null, null, null, null, null, null, null, '1提高了网络的可靠性2方便灵活3改进了系统的性能4便于建网5增加了地理上的覆盖范围', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('612', '4简述统一资源定位器的定义及组成。', null, null, null, null, null, null, null, '统一资源定位器是www上面的一种编址机制，用于对www资源进行定位以便于检索和浏览。由三部分组成 1代码 2服务器地址标识 3该服务定位文档的全路径名', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('613', '5.简述帧中继装拆设备的主要功能。', null, null, null, null, null, null, null, '1具有协议转换功能 2具有拥塞管理和控制 3具有集中功能，可接入多个用户 4具有维护和测试功能', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('614', '6.计算机通信网的主要任务。', null, null, null, null, null, null, null, '1.数据传输2提供资源共享3提高系统可靠性4进行分布式处理5对分散对象提供实时集中控制与管理功能6节省软硬件的开销7方便用户，易于扩充', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('615', '7.计算机网络分层对网络协议带来的好处。', null, null, null, null, null, null, null, '1各层之间是独立的 2灵活性强 3结构上可分割 4易于实现和推广 5能促进标准化工作', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('616', '8.局域网环形拓扑结构的缺点。', '', null, null, null, null, null, null, '1站点故障容易引发全网瘫痪2诊断故障困难3不易重新配置网络', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('617', '9.网桥的功能。', null, null, null, null, null, null, null, '1帧的接收和发送2缓冲存储3协议转换4差错控制5寻址和路由选择6速率匹配', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('618', '10.拥塞结束后TCP采取的窗口恢复策略。', null, null, null, null, null, null, null, '采用一种慢启动策略，慢启动过程是：在在一条新连接或者经过一定时间拥塞后开始恢复连接上传输数据时，都要从大小为1的窗口上进行开始，以后每收到一个确认，窗口大小增加1', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('620', '11.简述用户进程实现端到端可靠通信服务必须解决的问题。', null, null, null, null, null, null, null, '①在一个连接上多对进程之间的通信复用；②在一个网络连接中的各个通信子网所提供的服务存在着差异和不足；③通信子网中各层存在着自身不能解决的传输错误。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('621', '12.简述OSI中（N）服务的组成。', null, null, null, null, null, null, null, '①（N）实体自己提供的某些功能；②从（N-1）层及以下各层以及本地环境的到的服务；③通过与处在另一开放系统中的对等（N）实体的通信而得到的服务。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('622', '13.简述环形拓扑结构的优点。', null, null, null, null, null, null, null, '①传输速率高，误码率低；②网络接口比较简单；③电缆长度短。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('623', '14简述网关常用的流量控制方式。', null, null, null, null, null, null, null, '①源站仅在得到允许时才进行传输；②强制源站减少它们向网络提供的负荷；③采用咨询服务。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('624', '15.简述时间压缩复用方式。', null, null, null, null, null, null, null, '时间压缩复用方式又称乒乓方式，将连续比特流分割成等长的数据块，压缩成高速脉冲串后，在一对平衡线对上分时交替传输。发送时将存放在发送缓存器的数据块以脉冲串形式高速传送到线路上。接收时将高速脉冲串存入接收缓存器，均衡后再恢复成原速率的持续的比特流。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('625', '16.OSI环境中，网络本身的安全威胁种类。', null, null, null, null, null, null, null, '①未经许可地析出信息；②未经许可地篡改信息；③未经许可地拒绝或终止一些用户对资源的使用。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('626', '17.排队系统中服务员数目。', null, null, null, null, null, null, null, ' 答：服务员数目m就是排队系统内可以同时提供服务的设备或窗口数，它表示服务机构的资源。在计算机通信网中，m常指分组交换节点的输出信道数量。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('627', '18.OSI的表示层功能。', null, null, null, null, null, null, null, ' 答：表示层的作用是保证所传送的数据经传输后其意义不变。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('628', '19.CSMAVCD总线网的特点。', null, null, null, null, null, null, null, ' 答：①竞争总线；②冲突显著减少；③轻负荷有效；④广播式通信；⑤发送和应答时间具有统计性；⑥总线结构和MAC规程简单。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('629', '20.路由器的基本功能。', null, null, null, null, null, null, null, ' 答：①选择最佳传输路由；②能支持多种协议的路由选择；③流量控制；④分段和重新组装功能；⑤网络管理功能。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('630', '21简述帧中继的帧结构。', null, null, null, null, null, null, null, ' 答：F：标志字段→A：地址字段→I：信息字段→FCS：帧校验序列→F：标志字段。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('631', '22.简述TCPIP中片重组方式的缺点。', null, null, null, null, null, null, null, '①IP数据报一旦被较小MTU网络分片后，接下去假如又经过较大MTU网络，将导致带宽的浪费；②分片越多，丢失概率则越大，而分片一旦丢失，整个数据报则不能重组，且不能重传。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('632', '23.简述TCP协议在数据传送过程中检测和处理数据丢失的机制。', null, null, null, null, null, null, null, ' 答：“确认与超时重传机制”，假设第一个段丢失，而发送方在发送下一数据时并不需等待接收方的ACK，而是不断地连续发送。当超时时间到，重发丢失段。接收端收到重发丢失段后，要发送一ACK以证实此前所有段是否已完全到达。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('633', '24.简述理想的路由算法特点。', null, null, null, null, null, null, null, ' 答：①算法必须正确；②算法简单；③算法具有自适应性；④算法具有稳定性；⑤算法对所有用户平等；⑥算法应在某一特定条件下是最佳的。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('634', '25.简述网关的功能。', null, null, null, null, null, null, null, ' 答：①具有协议转换能力；②具有流量控制和拥塞控制的能力；③具有在各网络之间可靠传送信息的能力；④具有路由选择功能；⑤具有将分组分段和组装的能力。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('635', '26.在Internet上发送电子邮件的基本过程', null, null, null, null, null, null, null, ' 答：①写信或便条；②告诉邮件客户程序将信发至某个人或某些人；③客户程序将E-mail发给服务提供者邮件服务器；④邮件服务器使用SMTP将邮件在服务器之间传递，邮件在Internet上传递时分成包的形式；⑤邮件到达目的地服务器；⑥目的地服务器将邮件放到接收者的邮箱里；⑦接收者用其邮件客户程序阅读邮件。', null, '3', '10', '1');
