INSERT INTO `examination_record` VALUES ('639', '\r\n30.令牌环局域网帧的发送方式。', null, null, null, null, null, null, null, ' 答：当一个站要发送数据时，要先将数据信息形成帧并存放在发送缓冲区中，然后命令干线耦合器去截获令牌。干线耦合器不断地检测环中流动的比特流，当发现令牌帧时，便将其截获，然后就将发送缓冲区中的数据帧送入环路。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('640', '31.简述实现局域网与WAN互连需解决的技术问题。', null, null, null, null, null, null, null, '①局域网如何在物理上与WAN互连；②两个不同地方的局域网怎样通过与其相连的WAN进行通信；③一个网络的协议和体系结构能够在多大程度上为另一个网络所使用；④带宽的差异会引起确认处理和流量控制的方法有所不同，如何处理这种差异带来的问题；⑤怎样解决由于网络的时延不同而影响用户的响应时间这一矛盾；⑥虽然一个单个的局域网德地址结构比一个WAN要简单得多，但是当许多局域网通过WAN进行通信时，怎样才能解决这个复杂的寻址问题。', null, '3', '10', '1');
