INSERT INTO `examination_record` VALUES ('681', '66.简述TCPIP分片的重组方式及其优越性。', null, null, null, null, null, null, null, 'TCPIP规定：所有片重组在目的主机进行。优越性：TCPIP的这种重组方式使该片独立路由选择，不要求中间网关存储和重组分片，简化了网关协议，减轻了网关负担，使得分组能以最快速度到达目的节点。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('682', '67.饱和集法的步骤。', null, null, null, null, null, null, null, '（1）路由选择；（2）确定饱和集；3）增添链路；（4）删除链路；（5）扰动。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('683', '68.理想的路由算法特点。', null, null, null, null, null, null, null, '（1）算法必须正确；（2）算法简单；（3）算法具有自适应性；（4）算法具有稳定性；', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('684', '69.网络互连给网络系统带来的好处。', null, null, null, null, null, null, null, '（1）提高了网络的可靠性；（2）方便灵活； （3）改进了系统的性能；（4）便于建网；（5）增加了地理上的覆盖范围。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('685', '70.TCP连接建立机制。', null, null, null, null, null, null, null, 'TCP连接建立机制，提供了三次握手的方法。第一次，发送端机发出连接请求CR，该请求中包括发送端机的初始报文序号；第二次，接收端机收到CR后，发回连接确认CC，', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('686', '71.时间压缩复用方式。', null, null, null, null, null, null, null, '时间压缩复用方式又称乒乓方式。将连续比特流分割成等长的数据块，压缩成高速脉冲串后，在一对平衡线对上分时交替传输。发送时将存放在发送缓冲器的数据块以脉冲串形式高速传送到线路上。接收时将高速脉冲串存入接收缓冲器，均衡后再恢复成原速率的持续的比特流。', null, '3', '10', '1');
INSERT INTO `examination_record` VALUES ('687', '72.网络管理的内容。', null, null, null, null, null, null, null, '(1)对各种被访问的资源都要进行统一编址，以利于访问；（2)要将网络中每一个传输分组所占用和消耗网络中的各种资源的情况记录下来，以便按合理的方式向用户收费；（3)在共有网络中，当因为各种用户对服务的要求不尽相同，而发生矛盾时，网络应按用户的特殊要求(如路由、流量、安全性等）进行协商处理；（4）网络应设有监控系统、差错和故障的报告、故障定位和恢复系统。使网络能够随时了解到任何部位的状况，有时还要求网络设有统计性能分析功能。', null, '3', '10', '1');
